    url(/images/footer-bg-img.jpg) no-repeat center center;
  width: 100vw;
  margin-top: 8vw;
}

.footer-selections {
  display: flex;
  flex-direction: column;
}

.footer-selections-top {
  text-align: center;
  padding: 1vw 1vw 2vw;
  width: 90%;
  display: flex;
  justify-content: space-around;
  margin: 0 auto;
  li {
    display: inline-block;
    text-transform: uppercase;
    a {
      color: white;
      font-weight: 100;
    }
  }
}

.footer-selections-middle {
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  padding: 1vw 5vw 4vw;
  color: white;
  h5 {
    font-weight: 500;
    padding-bottom: 6px;
    border-bottom: 2px solid white;
    width: 100%;
    margin-bottom: 0.8vw;
    font-size: 1.1rem;
  }
  a {
    color: white;
    font-weight: lighter;
    font-size: 0.8rem;
  }
  li {
    text-transform: capitalize;
  }
}

.footer-selections-bottom {
  margin: 0 auto;
  h3 {
    color: white;
    text-align: center;
    font-size: 0.8rem;
    font-weight: 100;
    margin: 2vw;
  }
  ul {
    text-align: center;
  }
  li {
    display: inline-block;
    text-transform: uppercase;
    margin-right: 1vw;
    i {
      color: white;
      font-weight: 100;
      font-size: 1.7rem;
      text-shadow: 1px 1px 2px #222;
      transition: 100ms all ease-in-out;
      &:hover {
        color: $textGreen;
      }
    }
  }
}

